(function($) {
  
  Drupal.behaviors.mobile_menu = {};
  Drupal.behaviors.mobile_menu.attach = function(context) {
    
    var $mobile_menu = $('.region-zone-menu-mobile');
    
    // Hide the not active submenu.
    $('.region-zone-menu-mobile ul.level-3').hide();
    // Show the active submenu.
    $('.region-zone-menu-mobile ul.level-3 a.active').first().parents('ul.level-3').prev('a.link-text').addClass('active');
    $('.region-zone-menu-mobile ul.level-2 a.active').first().next('ul.level-3').show().addClass('toggle');
    
    $(window).resize(function() {
      if ($mobile_menu.hasClass('toggle')) {
        if ($("body").width() > 767) {
          closeMenu();
          return false;
        }
        $('#slider-container').width($(window).width() - ($mobile_menu.width() + 10));
      }
      if($("#block-cap-custom-footer-countries").hasClass('toggle') && $("body").width() < 767) {
        $("#footer-menu-popup-wrapper").remove();
        $("#block-cap-custom-footer-countries").removeClass('toggle');
      }
    });
    
    // Bind the menu button that open the mobile menu
    $('.button-menu-mobile').unbind('click').click(function(event) {
      if (!$('.mobile-cookie-authorization').size()) {
        var $cookie_mes = $('.cookie-authorization p').html();
        $mobile_menu.append('<div class="mobile-cookie-authorization">' + $cookie_mes + '</div>');
      }
      if (!$('.mobile-small-footer-menu').size()) {
        var $footer_menu = $('#block-cap-navigation-small-footer-menu').html();
        $mobile_menu.append('<div class="mobile-small-footer-menu">' + $footer_menu + '</div>');
      }
      
      if ($mobile_menu.hasClass('toggle')) {
        closeMenu();
        return false;
      } 
      else {
        $mobile_menu.show().addClass('toggle');
        $('.cookie-authorization').hide();
        $('#block-cap-navigation-small-footer-menu').hide();
        if ($('#cap-consulting').size()) {
          $('#cap-consulting').hide();
        }
        // Get header's height:
        var header_height = ($('#zone-header-second').size() > 0) ? $('#zone-header-second').height() : 0;
        // Start animation:
        $('html,body').animate({
          'scrollTop': header_height
        }, 200);
        $('body').addClass('mobile-menu-open');
        $('#main').width('767');
        $('#slider-container').height(($mobile_menu.height() + header_height) - $('#slider-container').position().top);
        $('#slider-container').width($(window).width() - ($mobile_menu.width() + 10));
        return false;
      }
    });
    
    // Bind the not active first level links, to toggle submenu.
    $('.region-zone-menu-mobile ul.level-2 > li > a').unbind('click').click(function(event) {
      event.preventDefault();
      var $menu_children = $(this).next('ul.level-3');
      if ($menu_children.hasClass('toggle')) {
        $menu_children.slideUp(100, function(event) {
          $('#slider-container').height($mobile_menu.height());
        }).removeClass('toggle');
      }
      else {
        $('.region-zone-menu-mobile ul.level-2>li>ul.toggle').slideUp(100).removeClass('toggle');
        $menu_children.slideDown(200, function(event) {
          $('#slider-container').height($mobile_menu.height());
        }).addClass('toggle');
      }
      return false;
    });
    
    /**
     * Permit to close correctly mobile menu
     */
    function closeMenu() {
      $mobile_menu.hide().removeClass('toggle');
      if ($('#cap-consulting').size()) {
        $('#cap-consulting').hide();
      }
      $('.cookie-authorization').show();
      $('#block-cap-navigation-small-footer-menu').show();
      $('body').removeClass('mobile-menu-open');     
      $('#slider-container').height('auto');
      $('#slider-container').width('auto');
      $('#main').width('auto');
    }
  }; 
})(jQuery);
