(function ($) {

  /**
   * Apply custom render "Select2" for a specific select box.
   */
  applySelect2 = function (select, theme) {
    // Get selectbox which needed custom display.
    var form =  select.find('select.form-select');

    if(form.length) {
      select.removeClass('select2-disable').find('.select-label').remove();
      form.select2({
        containerCssClass: "select2-" + theme,
        dropdownCssClass: theme
      }).bind('open', function() {
          $('.select2-search').remove();
        });
    }
  }

  $(document).ready(function(){
    if (!is_touch_device() && $('window').select2 !== undefined) {
      // Generic select in green color everywhere.
      if ($('.select-green-wrapper').length) {
        var selectWrapper = $('.select-green-wrapper:not(.processed-select)');
        $.each(selectWrapper, function ( index, item) {
          var currentSelect = $(item);
          currentSelect.addClass('processed-select');
          if (!currentSelect.hasClass('select2-not-use')) {

            // Check if we need to add "bigdrop" class.
            var bigDrop = ['expert-connect-expertise', 'expert-connect-industry', 'expert-connect-country'];

            var classes = 'grey';

            $.each(bigDrop, function ( index, item) {
              if (currentSelect.hasClass(item)) {
                classes += ' bigdrop';
                return false;
              }
            });
            applySelect2(currentSelect, classes);
          }
          else {
            var selectSpan = currentSelect.find('.select-label').children('.select-label-inner');
            selectSpan.text(currentSelect.find('option:selected').text());

            currentSelect.find('select.form-select').bind('change', function() {
              selectSpan.text(currentSelect.find('option:selected').text());
            });
          }
        });
      }

      // Block media contacts.
      if ($('#country-contacts-select').length) {
        var select = $('#country-contacts-select');
        applySelect2(select, 'dark', '400');
      }
    }
    else {
      $('.select2-disable').each( function() {
        var selectSpan = $(this).find('.select-label').children('.select-label-inner');
        selectSpan.text($(this).find('option:selected').text());
        $(this).find('select.form-select').bind('change', function() {
          selectSpan.text($(this).find('option:selected').text());
        });
      });
    }

  });

})(jQuery);;
